package Exception;

public class ArrayIndexOutOfBoundsExceptionExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String data1 = args[0];
		String data2 = args[1];
		
		System.out.print("args[0] : " + data1);
		System.out.print("args[1] : " + data2);
	}
	
}
